import React from 'react';

function TodoItem(props){
	return(
		<div className="todo-item">
			<input 
				type="checkbox" 
				checked={props.clicked}
				onClick={props.handleClick}
			/>
			<p>{props.task}</p>
		</div>
		);
}

export default TodoItem;
